INSERT INTO timeline.history (id, timeline, period, original_location, current_location, highlights, description, image)
VALUES(1, 'The Incan Civilization', '1438 A.D. â€“ 1532 A.D.', 'Ancient Peru', 'Peru, Ecuador, Chile', 'Machu Picchu, engineering excellence', 'The Inca Empire, also known as Incan Empire and the Inka Empire, and at the time known as the Realm of the Four Parts, was the largest empire in pre-Columbian America. The administrative, political and military center of the empire was in the city of Cusco. The Inca civilization arose from the Peruvian highlands sometime in the early 13th century. The Spanish began the conquest of the Inca Empire in 1532 and its last stronghold was conquered in 1572.', 'data:image/svg+xml;base64,'), (2, 'The Aztec Civilization', '1325 A.D. â€“ 1521 A.D.', 'South-central Mexico', 'Mexico', 'Highly advanced and complex society', 'The Aztecs were a Mesoamerican culture that flourished in central Mexico in the post-classic period from 1300 to 1521. The Aztec peoples included different ethnic groups of central Mexico, particularly those groups who spoke the Nahuatl language and who dominated large parts of Mesoamerica from the 14th to the 16th centuries. Aztec culture was organized into city-states, some of which joined to form alliances, political confederations, or empires. The Aztec Empire was a confederation of three city-states established in 1427: Tenochtitlan, city-state of the Mexica or Tenochca; Texcoco; and Tlacopan, previously part of the Tepanec empire, whose dominant power was Azcapotzalco.', 'data:image/svg+xml;base64,'), (3, 'The Roman Civilization', '753 B.C. â€“ 476 A.D.', 'The Tiber River in Italy', 'Rome', 'Monumental architecture', 'In modern historiography, ancient Rome refers to Roman civilization from the founding of the city of Rome in the 8th century BC to the collapse of the Western Roman Empire in the 5th century AD. It encompasses the Roman Kingdom 753â€“509 BC, Roman Republic 509â€“27 BC and Roman Empire 27 BCâ€“476 AD until the fall of the western empire.', 'data:image/svg+xml;base64,'), (4, 'The Persian Civilization', '550 B.C. â€“ 331 B.C.', 'Egypt in the west to Turkey in the north, through Mesopotamia to the Indus River in the east', 'Modern-day Iran', 'Royal road', 'The Achaemenid Empire, also called the First Persian Empire, was an ancient Iranian empire that was based in Western Asia and founded by Cyrus the Great in 550 BC. It reached its greatest extent under Xerxes I, who conquered most of northern and central ancient Greece. At its greatest territorial extent, the Achaemenid Empire stretched from the Balkans and Eastern Europe in the west to the Indus Valley in the east. The empire was larger than any previous empire in history, spanning a total of 5.5 million square kilometers 2.1 million square miles.', 'data:image/svg+xml;base64,'), (5, 'The Ancient Greek Civilization', '2700 B.C. â€“ 479 B.C.', 'Italy, Sicily, North Africa, as far west as France', 'Greece', 'Concepts of democracy, the Senate, the Olympics', 'Ancient Greece was a northeastern Mediterranean civilization, existing from the Greek Dark Ages of the 12thâ€“9th centuries BC to the end of classical antiquity c. AD 600, that comprised a loose collection of culturally and linguistically related city-states and other territoriesâ€”unified only once, for 13 years, under Alexander the Greats empire 336-323 BC. In Western history, the era of classical antiquity was immediately followed by the Early Middle Ages and the Byzantine period.', 'data:image/svg+xml;base64,'), (6, 'The Chinese Civilization', '1600 B.C. â€“ 1046 B.C.', 'Yellow River and Yangtze region', 'Country of China', 'Invention of paper and silk', 'The earliest known written records of the history of China date from as early as 1250 BC from the Shang dynasty c. 1600â€“1046 BC, during the king Wu Dings reign, who was mentioned as the twenty-first King of Shang by the same. Ancient historical texts such as the Book of Documents early chapters, 11th century BC, the Bamboo Annals c. 296 BC and the Records of the Grand Historian c. 91 BC mention and describe a Xia dynasty c. 2070â€“1600 BC before the Shang, but no writing is known from the period, and Shang writings do not indicate the existence of the Xia.', 'data:image/svg+xml;base64,'), (7, 'The Mayan Civilization', '2600 B.C. â€“ 900 A.D.', 'Around present-day Yucatan', 'Yucatan, Quintana Roo, Campeche, Tabasco, and Chiapas in Mexico; south through Guatemala, Belize, El Salvador, and Honduras', 'Complex understanding of astronomy', 'The Maya civilization was a Mesoamerican civilization developed by the Maya peoples, and noted for its logosyllabic scriptâ€”the most sophisticated and highly developed writing system in pre-Columbian Americasâ€”as well as for its art, architecture, mathematics, calendar, and astronomical system. The Maya civilization developed in the area that today comprises southeastern Mexico, all of Guatemala and Belize, and the western portions of Honduras and El Salvador. It includes the northern lowlands of the YucatÃ¡n Peninsula and the highlands of the Sierra Madre, the Mexican state of Chiapas, southern Guatemala, El Salvador, and the southern lowlands of the Pacific littoral plain.', 'data:image/svg+xml;base64,'), (8, 'The Ancient Egyptian Civilization', '3150 B.C. â€“ 30 B.C.', 'Banks of the Nile', 'Egypt', 'Construction of pyramids, mummification', 'Ancient Egypt was a civilization of ancient Africa, concentrated along the lower reaches of the Nile River, situated in the place that is now the country Egypt. Ancient Egyptian civilization followed prehistoric Egypt and coalesced around 3100 BC according to conventional Egyptian chronology with the political unification of Upper and Lower Egypt under Menes often identified with Narmer. The history of ancient Egypt occurred as a series of stable kingdoms, separated by periods of relative instability known as Intermediate Periods: the Old Kingdom of the Early Bronze Age, the Middle Kingdom of the Middle Bronze Age and the New Kingdom of the Late Bronze Age.', 'data:image/svg+xml;base64,')

